import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import SpongeBobCard from "./components/SpongeBobCard";
import SquidwardCard from "./components/SquidwardCard";
import MrKrabsCard from "./components/MrKrabsCard";
import FriendCard from "./components/FriendCard/FriendCard.js";
import friends from "./friends.json";
// import { tsPropertySignature } from "@babel/types";

function App() {
  console.log("Friends: " + friends);
  return (
    <Wrapper>
      <Title>Friends List</Title>
      {
        friends.map(friend => (
          <FriendCard var1={friend.name} />
        ))
      }
      {/* <SpongeBobCard />
      <MrKrabsCard />
      <SquidwardCard /> */}
      {/* <FriendCard /> */}
    </Wrapper>
    // <ul className="card">
    //   {friends.map((name, index) => {
    //     return <li key={index}>{name}</li>
    //   })}
    // </ul>

  );
}

export default App;
